import React, { useState, Fragment } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import Page from '../../components/page/Page';
import ProfileSubmenu from './ProfileSubmenu';
import './Profile.scss';

const Profile = ({ updated }) => {
    //detaisl | form
    const [currentTab, setCurrentTab] = useState('details');
    return (
        <Page title='Profile Page.'>
            {!updated && (
                <Fragment>
                    <div className='tile tile--info'>
                        Please create your profile.
                    </div>
                    <div className='tile tile'>form</div>
                </Fragment>
            )}
            {updated && <ProfileSubmenu setCurrentTab={setCurrentTab} />}
            {updated && currentTab === 'details' && (
                <div className='tile tile--md'>details</div>
            )}
            {updated && currentTab === 'form' && (
                <div className='tile tile--sm'>form</div>
            )}
        </Page>
    );
};

Profile.propTypes = {
    updated: PropTypes.bool,
};
const mapStateToProps = (state) => ({
    updated: state.profile.updated,
});
export default connect(mapStateToProps)(Profile);
